import "./App.css";
import React, { Component } from "react";
import Navbar from "./components/Navbar";
import News from "./components/News";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import LoadingBar from 'react-top-loading-bar'

export default class App extends Component {
  apiKey = "process.env.REACT_APP_NEWS_API"
  state ={
    progress:0
  }
  setProgress = (progress) =>{
    this.setState({progress:progress})
  }
  render() {
    return (
      <div>
        <Router>
          <Navbar />
            <LoadingBar
              color='#f11946'
              progress={this.state.progress}
            />
          <Routes>
            <Route exact path="/newsapp" element={<News apiKey={this.apiKey} setProgress={this.setProgress} key="1" pageSize={10} country="in" category="General" />} />
            <Route exact path="/home" element={<News apiKey={this.apiKey} setProgress={this.setProgress} key="0" pageSize={10} country="in" category="General" />} />
            <Route exact path="/sports" element={<News apiKey={this.apiKey} setProgress={this.setProgress} key="Sports" pageSize={10} country="in" category="Sports" />} />
            <Route exact path="/general" element={<News apiKey={this.apiKey} setProgress={this.setProgress} key="2" pageSize={10} country="in" category="General" />} />
            <Route exact path="/science" element={<News apiKey={this.apiKey} setProgress={this.setProgress} key="Science" pageSize={10} country="in" category="Science" />} />
            <Route exact path="/entertainment" element={<News apiKey={this.apiKey} setProgress={this.setProgress} key="entertainment" pageSize={10} country="in" category="Entertainment" />} />
            <Route exact path="/business" element={<News apiKey={this.apiKey} setProgress={this.setProgress} key="Business" pageSize={10} country="in" category="Business" />} />
            <Route exact path="/technology" element={<News apiKey={this.apiKey} setProgress={this.setProgress} key="Technology" pageSize={10} country="in" category="Technology" />} />
            <Route exact path="/health" element={<News apiKey={this.apiKey} setProgress={this.setProgress} key="Health" pageSize={10} country="in" category="Health" />} />
          </Routes>
        </Router>
      </div>
    );
  }
}
